import React from 'react'
import { Col, Row } from 'react-bootstrap';
import '../css/stylEmplo.css'
import DateCount from "./components/dataCount";
 const Employes = ({data}) => {
  return (
    
    
    <Row className="justify-content-center">
    <Col sm="8">
     <div className='boxing'>
      {data.length ? (data.map((item)=>{
        return( 
            
          <div key={item.id} className='d-flex border-bottom mx-4 my-3'>
          <img className='images' src={item.img} alt='no'/>
           
        <div className='px-4'>
          <p className='d-inline fs-4'> {item.name}</p>
          <p className=' fs-5'>{item.date} </p>
          <div className=''>age {item.age}</div>
        </div>
        
        
      </div>
        )
      })) : <h1> No Employee </h1>}
            
          </div>
      </Col>
   </Row>
   
  )
}
export default Employes;
